import { colors } from "../colors";
export const inputLabel = {
  root: {
    '& label': {
        color: colors.gray[400],
    },
    '& label.Mui-focused': {
        color: colors.green[400],
        borderBottomColor: "#1100FF",
    },
    
  },
};
